import React, { useState, useEffect, useCallback } from 'react';
import { useTranslation } from 'react-i18next';
import CarFilters from './CarFilters';
import CarCard from './CarCard';

const CarList = () => {
  const { t } = useTranslation();
  const [cars, setCars] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [filters, setFilters] = useState({});
  const [pagination, setPagination] = useState({
    count: 0,
    next: null,
    previous: null,
  });
  const [currentPage, setCurrentPage] = useState(1);

  // Use useCallback to memoize the fetchCars function
  const fetchCars = useCallback(async () => {
    setLoading(true);
    try {
      // Build query parameters
      const queryParams = new URLSearchParams();

      // Add pagination
      if (currentPage > 1) {
        queryParams.append('page', currentPage);
      }

      // Add filters
      Object.entries(filters).forEach(([key, value]) => {
        if (value) queryParams.append(key, value);
      });

      const queryString = queryParams.toString();
      const url = queryString ? `/api/cars/?${queryString}` : '/api/cars/';

      console.log('Fetching cars from:', url);

      const response = await fetch(url);
      if (!response.ok) {
        throw new Error(`API responded with status ${response.status}`);
      }

      const data = await response.json();
      console.log('Cars API response received');

      setCars(data.results || []);
      setPagination({
        count: data.count || 0,
        next: data.next,
        previous: data.previous,
      });
    } catch (error) {
      console.error('Failed to fetch cars:', error);
      setError(`Failed to fetch cars: ${error.message}`);
    } finally {
      setLoading(false);
    }
  }, [currentPage, filters]);

  // Initial fetch when component mounts - runs only once
  useEffect(() => {
    console.log('Initial car data fetch');
    fetchCars();
    // Empty dependency array means this runs once on mount
  }, []);

  // Handle filter changes
  const handleFilterChange = (newFilters) => {
    console.log('Filters changed, will fetch new data');
    setFilters(newFilters);
    setCurrentPage(1);
    fetchCars();
  };

  // Handle pagination
  const handlePreviousPage = () => {
    if (pagination.previous) {
      console.log('Moving to previous page');
      setCurrentPage(prev => {
        const newPage = prev - 1;
        // Use a callback to ensure we have the latest state value
        setTimeout(() => fetchCars(), 0);
        return newPage;
      });
    }
  };

  const handleNextPage = () => {
    if (pagination.next) {
      console.log('Moving to next page');
      setCurrentPage(prev => {
        const newPage = prev + 1;
        // Use a callback to ensure we have the latest state value
        setTimeout(() => fetchCars(), 0);
        return newPage;
      });
    }
  };

  // Search handler with debounce
  const handleSearch = (searchTerm) => {
    // Use a local variable to track the timeout
    let searchTimeout;

    // Clear any existing timeout
    clearTimeout(searchTimeout);

    // Set a new timeout to delay the search
    searchTimeout = setTimeout(() => {
      handleFilterChange({ ...filters, search: searchTerm });
    }, 500); // Wait 500ms after typing stops
  };

  return (
    <div className="container mx-auto px-4 py-8">
      {error && (
        <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded mb-4">
          <p className="font-bold">Error!</p>
          <p>{error}</p>
        </div>
      )}

      <div className="flex flex-col md:flex-row gap-6">
        {/* Filters */}
        <div className="w-full md:w-1/4">
          <CarFilters onFilterChange={handleFilterChange} />
        </div>

        {/* Car Listings */}
        <div className="w-full md:w-3/4">
          {/* Search Bar */}
          <div className="mb-6 flex">
            <input
              type="text"
              placeholder={t('common.search')}
              className="w-full px-4 py-2 border rounded-l-lg focus:outline-none focus:ring-2 focus:ring-indigo-500"
              onChange={(e) => handleSearch(e.target.value)}
            />
            <button className="bg-indigo-900 text-white px-4 py-2 rounded-r-lg hover:bg-indigo-800">
              <svg className="w-5 h-5" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M21 21l-6-6m2-5a7 7 0 11-14 0 7 7 0 0114 0z"></path>
              </svg>
            </button>
          </div>

          {/* Cars Grid */}
          {loading ? (
            <div className="flex justify-center py-8">
              <div className="loader"></div>
            </div>
          ) : cars.length === 0 ? (
            <div className="text-center py-8">
              <p className="text-gray-600">No cars found matching your criteria.</p>
            </div>
          ) : (
            <div className="space-y-4">
              {cars.map((car) => (
                <CarCard key={car.id} car={car} />
              ))}
            </div>
          )}

          {/* Pagination */}
          {pagination.count > 0 && (
            <div className="flex justify-between items-center mt-8">
              <button
                onClick={handlePreviousPage}
                disabled={!pagination.previous}
                className={`px-4 py-2 rounded ${
                  pagination.previous ? 'bg-indigo-900 text-white hover:bg-indigo-800' : 'bg-gray-300 text-gray-500 cursor-not-allowed'
                }`}
              >
                {t('common.previous')}
              </button>

              <span className="text-gray-600">
                Page {currentPage} of {Math.ceil(pagination.count / 10)}
              </span>

              <button
                onClick={handleNextPage}
                disabled={!pagination.next}
                className={`px-4 py-2 rounded ${
                  pagination.next ? 'bg-indigo-900 text-white hover:bg-indigo-800' : 'bg-gray-300 text-gray-500 cursor-not-allowed'
                }`}
              >
                {t('common.next')}
              </button>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default CarList;
